import React from 'react'

export const Rut = (props) => {
    const {datosFicha} = props
    return (
        <div className="card bg-card mb-3 size-card text-dark" >
            <div className="card-header">Rut</div>
            <div className="card-body mb-3">
                <span className="c-content">{datosFicha.rut}</span>
            </div>
        </div>

    )
}
